.btn {
    white-space: nowrap;

    &--variable {
        display: flex;
        align-items: center;
        padding: .6rem 1rem;
        background-color: $grey200;
        border-radius: $bdRadius;

        &,
        * {
            font-family: $fontSub;
        }

        .feather {
            --size: 20px;
            width: var(--size);
            height: var(--size);
            margin-left: .6rem;
        }
    }

    &--main {
        font-size: 1.3rem;
        border-radius: $bdRadius;
        color: white;
        @extend .bg-color--second;

        &:hover {
            color: white;
            opacity: .8;
        }
    }

}

