    max-height: calc(30px + 4rem);
    top: 0px;
    bottom: 0px;
    left: 0px;
    right: 0px;
    transform: translateX(35%);
    z-index: -1;

    img {
      object-fit: cover;
      object-position: bottom;
      max-height: inherit;
    }
  }
}

